import { string } from 'prop-types';
import styled from 'styled-components'


const Wrapper = styled.div`
    width: 100%;
    height: 100%;
    display: flex;
`;

export default function Product({product}){
    return <Wrapper>Product { atob(product) }</Wrapper>
}

Product.propTypes = {
    product: string.isRequired
};
